        Post::create([
            "foto" => "/app/Publicacion(TI1310)fbcarreteev.PNG",
            "titulo" => "Not managing contracts deteriorates outsourcing´s benefits between 5% and 30%.",
            "contenido" => '<p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);">Nowadays companies are looking for an outsourcing service to reduce their costs and risks, improve their productivity, and most importantly, focus their effort on their business core. </span></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);"> </span></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);">That is why within the business strategy, the contracting of different types of outsourcing services is becoming more and more frequent, from cybersecurity, technological infrastructure, help desk, accounting, to human development management. All services with different operational complexity, but with a common behavior by companies, focus on pre-signing contract activities (business requirements, tendering, contracting) and stop doing so in post-signing contract activities (transition, delivery, renewal or termination). </span></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);"> </span></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);">Signing a contract is only the beginning of a long-term relationship, so companies must quickly internalize the need for adequate controls and skilled collaborators to enforce - administratively and operationally - what is stipulated in the master contract and its annexes. </span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);">Leaving the contract saved in a drawer without controlling the service in an appropriate way, weakens the position of the company, generating a loss of value.</span></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);"> </span></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);">It is estimated between 5% and 30% of the loss of value due to not properly managing an outsourcing contract and the main reasons are as follows:</span></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);"> </span></p><p class="ql-align-justify">		<span class="ql-size-large ql-font-Raleway" style="color: rgb(0, 0, 104);">1. Unmanaged deliverables and obligations.</span></p><p class="ql-align-justify">		<span class="ql-size-large ql-font-Raleway" style="color: rgb(0, 0, 104);">2. Inaccurate interpretation of the contract.</span></p><p class="ql-align-justify">		<span class="ql-size-large ql-font-Raleway" style="color: rgb(0, 0, 104);">3. Errors in rates, invoices and calculations.</span></p><p class="ql-align-justify">		<span class="ql-size-large ql-font-Raleway" style="color: rgb(0, 0, 104);">4. Duplicate roles.</span></p><p class="ql-align-justify">		<span class="ql-size-large ql-font-Raleway" style="color: rgb(0, 0, 104);">5. Changes and service orders not required.</span></p><p class="ql-align-justify">		<span class="ql-size-large ql-font-Raleway" style="color: rgb(0, 0, 104);">6. Low adoption rates.</span></p><p class="ql-align-justify">		<span class="ql-size-large ql-font-Raleway" style="color: rgb(0, 0, 104);">7. Lack of innovation.</span></p><p class="ql-align-justify"><br></p><p class="ql-align-center"><span class="ql-size-large ql-font-Raleway" style="color: rgb(0, 0, 104);"><img src="data:image/png;base64," width="758" style=""></span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><strong class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);">How to prevent the value leakage of an outsourcing contract</strong></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);"> </span></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);">The company must apply two premises:</span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);"> </span></p><p class="ql-align-justify"><strong class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);"><em>Providing autonomy to the Outsourcing provider</em></strong></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);">The company must understand that it is no longer responsible for the operation, and therefore needs to empower the outsourcing service provider to do what it knows how to do. You must trust the decision you made when choosing the provider and not generate unnecessary confrontations that wear down the relationship.</span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);">It is clear that giving autonomy does not mean that the company should not ensure compliance with existing internal policies and regulations. </span></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);"> </span></p><p class="ql-align-justify"><strong class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);"><em>Properly manage the Outsourcing contract</em></strong></p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);">The company must have an outsourcing control team that enforces the provisions of the contract, for this requires key roles assumed by one or more collaborators, will depend on the complexity of the service:</span></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);"> </span></p><p class="ql-align-justify">		<span class="ql-size-large ql-font-Raleway" style="color: rgb(0, 0, 104);">1. Contract manager</span></p><p class="ql-align-justify">		<span class="ql-size-large ql-font-Raleway" style="color: rgb(0, 0, 104);">2. Service level manager.</span></p><p class="ql-align-justify">		<span class="ql-size-large ql-font-Raleway" style="color: rgb(0, 0, 104);">3. Consumption and billing manager</span></p><p class="ql-align-justify">		<span class="ql-size-large ql-font-Raleway" style="color: rgb(0, 0, 104);">4. Operating risk manager</span></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);"> </span></p><p class="ql-align-justify"><span class="ql-size-large ql-font-Raleway" style="background-color: transparent; color: rgb(0, 0, 104);">It is important to highlight that competencies such as analytical thinking, negotiation, planning and anticipation of opportunities and problems will prevail for these outsourcing control roles.</span></p>',
